import pandas as pd
from scipy.spatial import distance

# Load datasets
buildings_1740 = pd.read_csv('data/buildings_1740.csv')
landmarks = pd.read_csv('data/landmarks.csv')

# Step 3: Categorize Building Functions
def categorize_building_functions(row):
    if 'abitazione' in row['building_functions'] or 'casa' in row['building_functions'] or 'appartamento' in row['building_functions']:
        return 'residential'
    elif 'negozio' in row['building_functions'] or 'bottega' in row['building_functions'] or 'magazzino' in row['building_functions']:
        return 'commercial'
    else:
        return 'unknown'

buildings_1740['building_function_type'] = buildings_1740.apply(categorize_building_functions, axis=1)

# Step 4: Calculate Distance between Buildings and Squares
def calculate_distance(row):
    landmark_location = landmarks[landmarks['landmark_type'] == row['location']]['latitude']
    if not landmark_location.empty:
        return distance.euclidean((row['latitude'], row['longitude']), (float(landmark_location.iloc[0]), 0))
    else:
        return None

buildings_1740['distance_to_square'] = buildings_1740.apply(calculate_distance, axis=1)

# Step 5: Compare Distances for Residential and Commercial Buildings
residential_buildings = buildings_1740[buildings_1740['building_function_type'] == 'residential']
commercial_buildings = buildings_1740[buildings_1740['building_function_type'] == 'commercial']

mean_distance_residential = residential_buildings['distance_to_square'].mean()
if mean_distance_residential <= commercial_buildings['distance_to_square'].mean():
    final_answer = "yes"
else:
    final_answer = "no"

print(f"The answer is: [[{final_answer}]]")
